import React from "react";
import {useState, useEffect} from "react";

// react-bootstrap components
import {
  Badge,
  Button,
  Card,
  Form,
  Navbar,
  Nav,
  Container,
  Row,
  Col
} from "react-bootstrap";


function KospiNasdaq() {

  const [data, setData] = useState([{}])

  useEffect(() => {
      fetch("/kospiandnasdaq").then(
          res => res.json()
      ).then(
          data => {
            setData(data)
            console.log(data)
          }
      )

      }, [])

  return (
    <>
    {/*<div>
            <input type="text" placeholder="Search..." className="search" onChange={e => setSelect(e.target.value)}/>
            <ul className="list">
                {columns.map(column =>
                    <li className="listItem" id={column} key={column} >{column}</li>)}
            </ul>
        </div>
    <form>
        <div className="container p-5">
            <input type="text" list="column" placeholder="select"/>
            <datalist id="column">
            {(typeof columns === 'undefined')? (
                <p>Loading...</p>
            ) : (columns.map(column =>
                    <option id="col" key={column} >{column}</option>)
            )}
            </datalist>
            <button type="submit">조회</button>
        </div>
    </form>
    <div>
        <JsonToTable json={data.tips} />
    </div>*/}
    <Card>
              <Card.Header>
                <Card.Title as="h4">Users Behavior</Card.Title>
                <p className="card-category">24 Hours performance</p>
              </Card.Header>
              <Card.Body>
                <div className="ct-chart" id="chartHours">
                  <ChartistGraph
                    data={{
                      labels: [
                        "21/01",
                        "21/02",
                        "21/03",
                        "21/04",
                        "21/05",
                        "21/06",
                        "21/07",
                        "21/08",
                      ],
                      series: [
                        [287, 385, 490, 492, 554, 586, 698, 695],
                        [67, 152, 143, 240, 287, 335, 435, 437],
                        [23, 113, 67, 108, 190, 239, 307, 308],
                      ],
                    }}
                    type="Line"
                    options={{
                      low: 0,
                      high: 800,
                      showArea: false,
                      height: "245px",
                      axisX: {
                        showGrid: false,
                      },
                      lineSmooth: true,
                      showLine: true,
                      showPoint: true,
                      fullWidth: true,
                      chartPadding: {
                        right: 50,
                      },
                    }}
                    responsiveOptions={[
                      [
                        "screen and (max-width: 640px)",
                        {
                          axisX: {
                            labelInterpolationFnc: function (value) {
                              return value[0];
                            },
                          },
                        },
                      ],
                    ]}
                  />
                </div>
              </Card.Body>
              <Card.Footer>
                <div className="legend">
                  <i className="fas fa-circle text-info"></i>
                  Open <i className="fas fa-circle text-danger"></i>
                  Click <i className="fas fa-circle text-warning"></i>
                  Click Second Time
                </div>
                <hr></hr>
                <div className="stats">
                  <i className="fas fa-history"></i>
                  Updated 3 minutes ago
                </div>
              </Card.Footer>
            </Card>
    </>
  );

}

export default KospiNasdaq;
